using System;
using System.Collections.Generic;
using System.IO;
using System.Text;
using SixLabors.Fonts;
using SixLabors.ImageSharp;
using SixLabors.ImageSharp.Processing;
using SixLabors.ImageSharp.Drawing.Processing;
using SixLabors.ImageSharp.PixelFormats;

namespace SharpDevLib;

/// <summary>
/// draw verify code util
/// </summary>
public static class VerifyCodeUtil
{
    /// <summary>
    /// font from [https://github.com/FortAwesome/Font-Awesome/blob/master/webfonts/fa-brands-400.ttf]
    /// </summary>
    static readonly string _font = "";
    /// <summary>
    /// number seed data
    /// </summary>
    static readonly string seedDataWithOnlyNumber = "0123456789";
    /// <summary>
    /// seed data
    /// </summary>
    static readonly string seedData = "0123456789abcdefghigklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ";
    /// <summary>
    /// hot pixel seed data
    /// </summary>
    static readonly string symbolSeedData = "!@#$%^&*()_+-=~";
    /// <summary>
    /// color seed data
    /// </summary>
    static readonly List<Color> colorSeedData = new()
    {
        Color.Red,
        Color.Green,
        Color.Blue,
        Color.Black,
        Color.Pink,
        Color.DarkGreen
    };
    /// <summary>
    /// get random color
    /// </summary>
    /// <returns>color</returns>
    static Color GetRandomColor() => colorSeedData[new Random().Next(colorSeedData.Count)];

    /// <summary>
    /// generate verify code
    /// </summary>
    /// <param name="length">verify code length,default is 6</param>
    /// <param name="onlyNumber">is only contains number,default is true</param>
    /// <returns>verify code</returns>
    public static VerifyCodeResult GenerateCode(int length = 6, bool onlyNumber = true)
    {
        var seedData = onlyNumber ? seedDataWithOnlyNumber : VerifyCodeUtil.seedData;
        var random = new Random();
        var result = new StringBuilder();
        for (int i = 0; i < length; i++)
        {
            result.Append(seedData[random.Next(0, seedData.Length)]);
        }
        return new VerifyCodeResult(result.ToString());
    }

    /// <summary>
    /// generate verify code image
    /// </summary>
    /// <param name="length">verify code length,default is 6</param>
    /// <param name="onlyNumber">is only contains number,default is true</param>
    /// <returns>verify code</returns>
    public static VerifyCodeResult GenerateCodeImage(int length = 6, bool onlyNumber = true)
    {
        var code = GenerateCode(length, onlyNumber);
        code.Binary = GenerateImage(code.Code);
        return code;
    }

    static byte[] GenerateImage(string code)
    {

        var random = new Random();
        var length = code.Length;
        var width = 200;
        var height = 50;
        var fontSize = width / (length + 0.5f);
        var minTop = 2;
        if (minTop + fontSize >= height) minTop = 0;
        var maxTop = (height - fontSize) / 2;
        if (maxTop <= minTop) maxTop = minTop;

        var image = new Image<Rgba32>(width, height, new Rgba32(200, 240, 240, 240));
        FontCollection collection = new();
        var family = collection.Add(new MemoryStream(Convert.FromBase64String(_font)));

        //draw hot pixel
        var hotPixelFont = family.CreateFont(fontSize / 2, FontStyle.Italic);
        for (int i = 0; i < 8; i++)
        {
            image.Mutate(x => x.DrawText(symbolSeedData[random.Next(symbolSeedData.Length)].ToString(), hotPixelFont, GetRandomColor(), new PointF(random.Next(width), random.Next(height))));
        }

        //draw code
        var font = family.CreateFont(fontSize, FontStyle.Bold);
        for (int i = 0; i < length; i++)
        {
            var left = (i + 0.5f) * fontSize;
            var top = random.Next((int)minTop, (int)maxTop);
            image.Mutate(x => x.DrawText(code[i].ToString(), font, GetRandomColor(), new PointF(left, top)));
        }

        //draw hot pixel
        for (int i = 0; i < 8; i++)
        {
            image.Mutate(x => x.DrawText(symbolSeedData[random.Next(symbolSeedData.Length)].ToString(), hotPixelFont, GetRandomColor().WithAlpha(0.8f), new PointF(random.Next(width), random.Next(height))));
        }

        using var stream = new MemoryStream();
        image.SaveAsPng(stream);
        return stream.ToArray();
    }
}

/// <summary>
/// verify code result model
/// </summary>
public class VerifyCodeResult
{
    /// <summary>
    /// verify code result model
    /// </summary>
    /// <param name="code">verify code</param>
    public VerifyCodeResult(string code)
    {
        Code = code;
    }

    /// <summary>
    /// verify code
    /// </summary>
    public string Code { get; }

    /// <summary>
    /// verify code binary
    /// </summary>
    public byte[]? Binary { get; internal set; }

    /// <summary>
    /// base64 file
    /// </summary>
    public string Base64File => Binary.IsEmpty() ? string.Empty : $"data:image/jpeg;base64,{Convert.ToBase64String(Binary)}";

    /// <summary>
    /// save to file
    /// </summary>
    /// <param name="path">target path</param>
    public void SaveFile(string? path) => Binary.SaveFile(path);
}
